import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem,MDBNavbarItem, MDBNavLink, MDBContainer, MDBMask, MDBView, MDBDropdown, MDBIcon } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  NavLink,
} from "react-router-dom";
import SignIn from './SignIn';

import {
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBNavbarLink,
} from 'mdb-react-ui-kit';



import { useState } from 'react';
import { useSelector } from 'react-redux';
import ShowCompanies from './ShowCompanies';
import SignUp from './SignUp';
import CompanyUpdate from './CompanyUpdate';

 export default function FullPageIntroWithFixedNavbar()
{
  const [state,setState]=useState({ collapse: "false",isWideEnough: "false"});
    let IsCompany = useSelector((store) => {return store.Companies.company }); 
    console.log("IsCompany")
    console.log(IsCompany.codeCompany)

    return (
      <Router>
     
      <div>
        <header>
          
         
            <MDBNavbar color="indigo" dark expand="md" fixed="top">
              <MDBNavbarBrand href="/">
                <strong>Navbar</strong>
              </MDBNavbarBrand>
              {!state.isWideEnough && <MDBNavbarToggler onClick={onClick} />}
              <MDBCollapse isOpen={state.collapse} navbar>
                <MDBNavbarNav left>
                  <MDBNavItem active>
                <MDBNavbarLink><NavLink to="/">בית</NavLink></MDBNavbarLink>
                  </MDBNavItem>
                  

                  <MDBNavItem>
                    <MDBNavbarLink><NavLink  to="/SignIn">התחברות</NavLink></MDBNavbarLink>
                   
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavbarLink><NavLink  to="/SignUp">הרשמה</NavLink></MDBNavbarLink>
                   
                  </MDBNavItem>
                  <MDBNavItem>
            
                    <MDBNavbarLink><NavLink to="/SignUp">עדכון</NavLink></MDBNavbarLink>
            
                  </MDBNavItem>

                  <MDBNavbarItem><MDBDropdown>
                    <MDBNavbarToggler nav caret>
                      <MDBIcon icon="user"/>
                    </MDBNavbarToggler>
                  </MDBDropdown>
                  

                     </MDBNavbarItem>

                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>
          
          <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(50).webp">
            <MDBMask overlay="black-light" className="flex-center flex-column text-white text-center">
           
            </MDBMask>
          </MDBView>
        </header> 

        <main>
          <MDBContainer className="">
           <SignIn></SignIn>
          </MDBContainer>
        </main>
      </div>
          <Switch>
            <Route path='/SignIn' exact component={SignIn}></Route> 
            <Route path='/SignUp' exact component={SignUp}></Route> 
            <Route path='/CompanyUpdate/:companycode' exact component={CompanyUpdate}></Route> 
          </Switch>     
     
      </Router>
    );
    }
